import sys

def minp():
	return sys.stdin.readline().strip()

def mint():
	return int(minp())

def mints():
	return list(map(int,minp().split()))

def solve():
	bessie = mint()
	elsie = mints()
	if bessie == elsie:
		print("YES")
	else:
		print("NO")

def __starting_point():
	solve()

__starting_point()
